	@Test public void fillCharArray() {
		String input =
			"|a|\n"+
			"a := Array new: 5.\n"+
			"1 to: 5 do: [:i | a at: i put: $a + i].\n" +
			"^a";
		String expecting = "{$b. $c. $d. $e. $f}";
		execAndCheck(input, expecting);
	}

